    dataIndex: 'dopeople',
  },
  {
    title: '上传时间',
    dataIndex: 'time',
  },
  {
    title: '操作',
    scopedSlots: { customRender: 'action' },
    align: 'center',
    width: '230px',
  },
]
const dataSource = []
for (let i = 0; i < 8; i++) {
  dataSource.push({
    key: i,
    name: '北京协和医院',
    listPic:
      'data:image/png;base64,',
    grade: '三甲',
    type: '综合医院',
    dopeople: 'admin',
    time: '2020-02-07 21:00:00',
  })
}
export default {
  name: 'HospitalManage',
  inject: ['reloadCard'],
  data() {
    return {
      // 搜索栏
      search: true,
      areaList: [
        {
          value: 'zhejiang',
          label: 'Zhejiang',
          children: [
            {
              value: 'hangzhou',
              label: 'Hangzhou',
            },
            {
              value: 'xihu',
              label: 'West Lake',
            },
          ],
        },
        {
          value: 'jiangsu',
          label: 'Jiangsu',
          children: [
            {
              value: 'nanjing',
              label: 'Nanjing',
            },
            {
              value: 'zhonghuamen',
              label: 'Zhong Hua Men',
            },
          ],
        },
      ],
      queryInfo: {
        resName: '',
        area: undefined,
      },
      queryRules: {},
      // 表格
      tableLoading: false,
      columns,
      dataSource,
      selectedRowKeys: [],
      // 操作
      actionTitle: '新增药品',
      actionVisible: false,
      departmentList: [
        {
          key: '内科',
          title: '内科',
        },
        {
          key: '心内科',
          title: '心内科',
        },
        {
          key: '消化内科',
          title: '消化内科',
        },
        {
          key: '内分泌科',
          title: '内分泌科',
        },
      ],
      actionForm: {
        id: '',
        name: '',
        listPic: '',
        recommend: undefined,
        doctorNum: '',
        departmentNum: '',
        department: [],
        area: undefined,
        address: '',
        mobile: '',
        introduction: '',
      },
      actionRules: {
        name: [{ required: true, message: '请输入药品名称', trigger: 'blur' }],
        listPic: [{ required: true, message: '请上传列表图', trigger: 'change' }],
        recommend: [{ required: true, message: '请选择是否推荐', trigger: 'change' }],
        area: [{ required: true, message: '请选择所在地区', trigger: 'change' }],
        address: [{ required: true, message: '请选择详细地址', trigger: 'blur' }],
        mobile: [{ required: true, message: '请选择医院电话', trigger: 'blur' }],
        introduction: [{ required: true, message: '请输入详细介绍', trigger: 'blur' }],
      },

      // 上传图片
      uploading: false,
      // 查看详情
      viewVisible: false,
    }
  },
  methods: {
    // 搜索栏
    onSubmit() {
      this.$refs.queryRuleForm.validate((valid) => {
        if (valid) {
          alert('1')
        } else {
          console.log('error submit!!')
          return false
        }
      })
    },
    resetForm() {
      this.$refs.queryRuleForm.resetFields()
    },
    // 新增医生
    add() {
      this.actionTitle = '新增医生'
      this.actionVisible = true
      this.viewVisible = false
    },
    refresh() {
      this.reloadCard()
    },
    showSearch() {
      this.search = !this.search
    },
    changeTabs(key) {
      console.log(key)
    },
    // 表格
    // 勾选表单数据
    onSelectChange(selectedRowKeys) {
      console.log('selectedRowKeys changed: ', selectedRowKeys)
      this.selectedRowKeys = selectedRowKeys
    },
    // 操作抽屉
    afterActionVisibleChange(val) {
      console.log('visible', val)
      if (!val) {
        this.viewVisible = false
      }
    },
    actionOnClose() {
      this.actionVisible = false
      this.actionForm = this.$options.data().actionForm
    },
    actionOnSave() {
      this.$refs.actionRuleForm.validate((valid) => {
        if (valid) {
          alert('submit!')
        } else {
          console.log('error submit!!')
          return false
        }
      })
    },
    // 上传图片
    uploadHandleChange(info) {
      if (info.file.status === 'uploading') {
        this.loading = true
        return
      }
      if (info.file.status === 'done') {
        // Get this url from response in real world.
        getBase64(info.file.originFileObj, (imageUrl) => {
          console.log(imageUrl)
          this.actionForm.listPic = imageUrl
          this.loading = false
        })
      }
    },
    beforeUpload(file) {
      const isJpgOrPng = file.type === 'image/jpeg' || file.type === 'image/png'
      if (!isJpgOrPng) {
        this.$message.error('You can only upload JPG file!')
      }
      const isLt2M = file.size / 1024 / 1024 < 2
      if (!isLt2M) {
        this.$message.error('Image must smaller than 2MB!')
      }
      return isJpgOrPng && isLt2M
    },
    // 医院科室穿梭框
    filterOption(inputValue, option) {
      return option.title.indexOf(inputValue) > -1
    },
    departmentHandleChange(targetKeys, direction, moveKeys) {
      console.log(targetKeys, direction, moveKeys)
      this.actionForm.department = targetKeys
      console.log(this.actionForm)
    },
    departmentHandleSearch(dir, value) {
      console.log('search:', dir, value)
    },
    // 查看医生详情
    toView(record) {
      console.log(record)
      // this.actionForm = record
      Object.assign(this.actionForm, record)
      this.actionTitle = '医生详情'
      this.actionVisible = true
      this.viewVisible = true
    },
    // 编辑
    toEdit(record) {
      // this.actionForm = record
      Object.assign(this.actionForm, record)
      this.actionTitle = '编辑药品'
      this.actionVisible = true
    },
  },
}
